const TermosWebView = () => {
  const [web, setWeb] = useState('')
  const [isWeb, setIsWeb] = useState(false)
  function handleGo() {
    setIsWeb(true)
  }
  return (
    <>

      {true && (
        <View style={{ height: '70%', width: "80%" }}>
          <WebView
            source={{ uri: "https://www.rendimento.com.br/politica-de-privacidade/" }}
            style={{ marginTop: 20 }}
          />
        </View>
      )}

      {false && (
        <>
          <TextInput
            value={web}
            onChangeText={setWeb}
            style={styles.txt}
          />
          <TouchableOpacity style={styles.btn} onPress={handleGo}>
            <Text>Go</Text>
          </TouchableOpacity>
        </>
      )}

    </>
  )
}

